import React from 'react';

// {videos} take the place of props.videos
const VideoList = ({videos}) => {
    const videoItems = videos.map((video) => {
        return <li>{video.id}</li>
    });

    return (
        <div>
            {videoItems}
        </div>
    )
};

export default VideoList;
